	(58,57,50,1300289010,0,'Uw e-mailadres: caterpillarlove@hotmail.com\n\nOnderwerp: Idee/tip\n\nBericht: Geachte meneer van Driel,\r\n\r\nop nu.nl zag ik het bericht over het anoniem melden van een SOA. \r\n\r\nVoor misbruik bent u niet bang, omdat iemand de grap wel in kan zien als hij/zij nog nooit seksueel actief is geweest. \r\n\r\nIn het geval van een wraakactie van een boze expartner (o.i.d.) zal een dergelijk bericht een stuk meer gevolgen (kunnen) hebben. \r\n\r\nMijn idee: voor het versturen van een dergelijke anonieme email een wachtwoord/code inbouwen. Wanneer er een positieve uitslag is, kan de huisarts een code meegeven waarmee ingelogd kan worden om op deze manier een anonieme email te kunnen versturen. \r\n\r\nVerder vind ik het een prima initiatief, hopelijk zullen meer mensen zich hierdoor laten testen en bij besmetting andere mensen in kennis stellen. \r\n\r\nMet vriendelijke groet,\r\n\r\nSylvia Bottenheft\n\n\n\nIP: 62.177.157.186'),
