	(122,57,50,1300801922,0,'Uw e-mailadres: ooijenvana@hotmail.com\n\nOnderwerp: SOA-alarm\n\nBericht: Vorige week kreeg ik tot mijn stomme verbazing een SOA-alarm. Heb mijn drie bedpartners van het afgelopen jaar benaderd en het bleek niet van (een van) hen afkomstig te zijn. Gelukkig gaven ze ook aan dat ze mij persoonlijk benaderd zouden hebben in voorkomend geval. Nu denk ik dus dat iemand mij een (misselijke) grap flikt, of dat iemand mij waarschuwt terwijl het eigenlijk niet nodig is (dat ik per ongeluk op de adressenlijst terecht ben gekomen bijvoorbeeld).  Ik vind het prima dat er een anonieme dienst als SOA-alarm bestaat maar dat er in geval van misbruik niet te traceren is van wie een bericht komt vind ik een hele slechte zaak. Ondanks dat ik in theorie weet dat ik geen risico gelopen heb vind ik het alarm toch heel belastend, en ik zou heel graag de bevestiging willen krijgen dat het per abuis naar mij verstuurd is. Ik vind het krijgen van zo\'n alarm zodanig belastend dat ik het niet in verhouding vind dat iemand die ten onrechte zo\'n alarm verstuurd hier zomaar mee wegkomt. Graag verneem ik hierop uw reactie. Vriendelijke groeten, Annemieke van Ooijen  \n\n\n\nIP: 217.122.122.207'),
