	(144,57,50,1302031499,0,'Uw e-mailadres: vanessimo@hotmail.com\n\nOnderwerp: SOA HIV?\n\nBericht: Volgens mij is hier kwaad opzet in\'t spel van diegene die dit anoniem laat weten mits ik vorige week met een ex zwaar drama over SOA\'s had gehad....heb nl maand leden bloedtest laten doen voor jaarlijkse check up en laat steeds HIV testen, die negatief was...das wel toevallig na die aanvaring van vorige week dak ineens zoiets krijg wat ik echt niet als grappig kan beamen....moet ik nu maand later weer naar dokter lopen, die vent gaat mij voor gek verklaren...ga het zeker doen ma geloof hier niks van!!...ben in oktober 2010 en maart 2011 getest en had niks...en heb ondertussen niemand gehad....ik weet niet of die mensen die dit laten versturen zich ook moeten valideren??! ...ma als het Ã©ne Danny Van Buggenhout of Anneke Van Keer zijn....mogen ze wel ophouden met hun flauw grappen, dat doe je niet...en blijkbaar is misbruik hier al gauw van toepassing, stond week geleden pas in de Flair en hup \'t is al zo ver!!...Zou het apprecieren als men dit eens nakeek aub?????\r\nVriendelijk groeten Vanessa.\n\n\n\nIP: 84.197.153.1'),
