	(146,57,50,1302629132,0,'Uw e-mailadres: petravandelft@casema.nl\n\nOnderwerp: ontbrekende soa \n\nBericht: Ik heb (via een waarschuwing van een ander) ontdekt dat ik besmet ben met de gevraalijke variant van HPV. Dit is ook een sexueel overdraagbare aandoening die niet in t rijtje staat. Ik weet dat de kans klein is dat iemand daar iets aan overhoudt, maar zoja, dan is dat wel meteen baarmoederhalskanker, dus ik vind het serieus genoeg om anderen voor te waarschuwen. (Ik sta dankzij deze waarschuwing onder verscherpte controle). Dat doe ik persoonlijk, maar met 2 mensen heb ik liever geen contact meer, dus die doe ik graag via julie site. Kan dat please ? Zoja hoe, en zonee, willen jullie dan voor de toekomst zorgen dat anderen die mogelijkheid wel hebben ?\n\n\n\nIP: 83.83.103.99'),
