	(157,57,50,1305061884,0,'Uw e-mailadres: nicky.zuiderwijk@student.hu.nl\n\nOnderwerp: Onderzoek public health & internet\n\nBericht: Beste mensen achter soaalarm.nl,\r\n\r\nIk doe aan de Hogeschool Utrecht onderzoek naar het gebruik van sociale media in de gezondheidszorg en ben geÃ¯nteresseerd in onder andere de gedachte achter de oprichting van SOA Alarm en behaalde resultaten.\r\n\r\nMeestal is een afspraak van ca. een uur voldoende om de case voor ons goed in kaart te brengen en uiteraard krijgen jullie in ruil de onderzoeksresultaten van alle onderzoeken. Meewerken kan voor jullie dus ook zeer interessant zijn!\r\n\r\nIndien gewenst heb ik een aanvullende PDF met meer informatie over het onderzoek. Deze kan ik naar jullie opsturen.\r\n\r\nIk zou het bijzonder op prijs stellen als jullie mee willen doen!\r\n\r\nMet vriendelijke groet,\r\n\r\nNicky Zuiderwijk \n\n\n\nIP: 94.210.204.62'),
