	(184,57,50,1321008930,0,'Uw e-mailadres: stephaniekoelzow@hotmail.com\n\nOnderwerp: Chlamydia\n\nBericht: Beste Team SoaAlarm,\r\n\r\nIk heb helaas te horen gekregen dat ik in aanraking ben gekomen met clamydia. Via deze site heb ik 2 van de 3 mensen een email gestuurd, zodat zij ook op de hoogte zijn, van het mogelijk hebben van chlamydia. Ik kan helaas maar een emailadres niet invoeren, want het pakt hem niet. Het gaat om: e.denotter@hotmail.com. Ook deze wil ik graag anoniem op de hoogte brengen van mij opgelopen bacterie. Kunnen jullie mij hierbij helpen? Ik hoop snel van jullie te horen.\r\n\r\nMet vriendelijke groet,\r\n\r\nStephanie \r\n\r\n\n\n\n\nIP: 81.204.211.132'),
