	(194,57,50,1338899182,0,'Uw e-mailadres: vasiaria@live.nl\n\nOnderwerp: soa overzicht\n\nBericht: Waarom staat het HPV-virus (het enige virus dat (baarmoederhals)kanker veroorzaakt en in uitzonderlijke gevallen ook peniskanker, keelkanker enz.) niet in het soa overzicht? Ik had een agressieve vorm, had contactbloedingen, ben geopereerd na 2 jaar en dat heeft niet geholpen, het is alleen weer erger geworden. Ik heb mijn bedpartner gewaarschuwd dat hij het dus ook heeft, maar hij ging vlak voor mijn operatie met een ander op vakantie en heeft daarna het bed alweer gedeeld met minimaal 2 vrouwen terwijl hij weet dat hij ze kan besmetten, maar dat kan hem niet schelen want hij kan zelf niks krijgen van HPV, hij gebruikt ook nooit condooms, en ik maak mij zorgen om die andere vrouwen. Mocht u HPV toch in het overzicht gaan zetten, zet er dan bij dat ze specifiek om een HPV-test moeten vragen, want artsen doen vaak een uitstrijkje en als dat goed is nemen ze aan dat je geen HPV hebt en andersom maar dat gaat dus niet op\n\n\n\nIP: 82.171.230.209'),
