	(196,57,50,1341412796,0,'Uw e-mailadres: robin@cg.nl\n\nOnderwerp: Samenwerking\n\nBericht: Graag zouden ik contact willen hebben met Soaalarm om een mogelijke samenwerking te bespreken. Wij zijn eigenaar van o.a. Nederlands grootste condoom websites Condooms.nl en Condoomfabriek.nl. Jaarlijks verkopen wij duizenden SOA testen middels onze zelftest categorie. Het lijkt ons interessant om bij alle SOA testen ook jullie website SOAalarm onder de aandacht te brengen voor het geval er daadwerkelijk sprake is van een SOA.\r\n\r\nVerneem graag van u.\n\n\n\nIP: 62.195.109.233'),
