	(202,57,50,1354716336,0,'Uw e-mailadres: roeffen.gijs@gmail.com\n\nOnderwerp: Misbruik\n\nBericht: Geachte,\r\n\r\nGisteren en vandaag zijn meerdere malen mails gestuurd naar gijs@aleto.nl / roeffen.gijs@gmail.com. Beide met het bericht dat ik Hepatitis B zou hebben. Gezien het feit dat ik vorige maand een uitgebreid onderzoek heb gehad incl. SOAs en op dit moment enkel beschermde sex heb met mijn partner lijkt het me zeer stug. Ik weet dat het niet gebruikelijke gang van zaken is dat jullie een e-mail adres verstrekken van de verstuurder maar ben toch wel zeer benieuwd erna.\r\n\r\nMocht dit in welke hoedanigheid dan niet mogelijk zijn dan wil ik graag verzoeken mijn e-mail adres te laten blokkeren bij jullie diensten (gijs@aleto.nl / roeffen.gijs@gmail.com) daar ik zoals -ieder gezond mens zou moeten zijn- altijd uitkijk voor een mogelijke SOA en de nodige maatregelen neem.\r\n\r\nMet vriendelijke groet,\r\n\r\nGijs Roeffen\r\n\n\n\n\nIP: 212.178.120.174'),
