	(218,57,50,1382003952,0,'Uw e-mailadres: homoss@live.nl\n\nOnderwerp: SOA via sms versturen door GGD?\n\nBericht: Ik ben positief getest op Lues en inmiddels behandeld. Ik heb geen e-mailadressen om een SOA Alarm te versturen maar wel enkele telefoonnummers van mensen die ik op de hoogte wil brengen. Kan de GGD voor mij deze mensen op de hoogte brengen?\n\n\n\nIP: 84.27.192.111'),
