	(227,57,50,1423652684,0,'Uw e-mailadres: mlesquillier@gmail.com\n\nOnderwerp: anonieme melding\n\nBericht: Ik kreeg gisteravond om 21:10u een anonieme melding van soa-alert; ik heb op de link geklikt en en er is iemand in mijn omgeving die chlamydia heeft. \r\nDe melding is vreemd aangezien ik en mijn partner 4 jaar geleden ook al getest zijn op verschillende soa\'s waaronder deze omdat de ex-partner van mijn vriend toen beweerde dat hij haar deze soa (chlamydia) had bezorgd. Uit onze testen destijds bleek dat wij beiden GEEN soa hadden, gehad hadden of bij ons droegen. \r\nIn december vorig jaar hebben wij beiden ons aangemeld als bloeddonor. Ook dan wordt je getest op SOA\'s. Ook nu bleek van geen SOA sprake.\r\nIk heb dan ook sterk het vermoeden dat iemand uit ons verleden mij deze melding heeft gestuurd om vervelend te zijn.\r\nIk heb gisteravond mijn mailadres afgemeld voor dit soort meldingen.\r\nMocht u een antwoord willen versturen dan kan dat ook naar dgd.cordes@gmail.com\n\n\n\nIP: 80.61.82.55'),
