INSERT INTO `soaCMS_mod_wysiwyg` (`section_id`, `page_id`, `content`, `text`)
VALUES
	(0,0,'',''),
	(3,1,'<h3>Een SOA heb je nooit alleen!</h3>\r\n<p>Ieder jaar lopen honderdduizend Nederlanders een Seksueel Overdraagbare Aandoening op. Sommige SOA hebben zeer ernstige gevolgen. Je bent besmettelijk vanaf het moment dat je de SOA hebt opgelopen. Het is daarom belangrijk om je bedpartners direct te waarschuwen. Soms is dat niet gemakkelijk, bijvoorbeeld wegens schaamte, reputatie of religieuze redenen. Met SOA Alarm kun je iedereen direct en anoniem op de hoogte stellen van de geslachtsziekte die zij mogelijk hebben opgelopen.</p>\r\n<p>Neem verantwoordelijkheid en waarschuw nu direct je intieme contacten met SOA Alarm. Zo voorkom je dat de geslachtsziekte verder wordt verspreid, of voor anderen pijnlijke gevolgen krijgt.</p>','Een SOA heb je nooit alleen!\r\nIeder jaar lopen honderdduizend Nederlanders een Seksueel Overdraagbare Aandoening op. Sommige SOA hebben zeer ernstige gevolgen. Je bent besmettelijk vanaf het moment dat je de SOA hebt opgelopen. Het is daarom belangrijk om je bedpartners direct te waarschuwen. Soms is dat niet gemakkelijk, bijvoorbeeld wegens schaamte, reputatie of religieuze redenen. Met SOA Alarm kun je iedereen direct en anoniem op de hoogte stellen van de geslachtsziekte die zij mogelijk hebben opgelopen.\r\nNeem verantwoordelijkheid en waarschuw nu direct je intieme contacten met SOA Alarm. Zo voorkom je dat de geslachtsziekte verder wordt verspreid, of voor anderen pijnlijke gevolgen krijgt.'),
	(6,6,'<h3>Veelgestelde vragen</h3>\r\n<p><strong>SOA Alarm is anoniem, waarom moet ik mijn e-mailadres opgeven?</strong><br />\r\nJe eigen e-mailadres wordt gevraagd ter verificatie om spam tegen te gaan.<br />\r\n&nbsp;<br />\r\n<strong>Kan ik niet gewoon zelf een e-mail sturen?</strong><br />\r\nZeker weten. SOA Alarm is slechts een hulpmiddel die je de mogelijkheid biedt mensen anoniem op de hoogte te stellen, mocht dat gewenst zijn. Persoonlijk contact geniet nog altijd de voorkeur.<br />\r\n&nbsp;<br />\r\n<strong>Ik heb een SOA&nbsp;Alarm ontvangen. Wat moet ik doen?</strong><br />\r\nNeem een  SOA&nbsp;Alarm altijd serieus. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts. Ook als je zelf (nog) geen klachten hebt. Waarschuw direct je sekspartners. Via SOA Alarm kan dat anoniem.</p>\r\n<p><strong>Ik heb een SOA&nbsp;Alarm ontvangen. Hoe weet ik zeker dat het geen  flauwe grap is?</strong><br />\r\nNeem een  SOA&nbsp;Alarm altijd serieus. Ook als  je zelf (nog) geen klachten  hebt. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<p><strong>Zien de bedpartners naar wie ik het SOA&nbsp;Alarm stuur elkaars e-mailadressen of namen?</strong><br />\r\nNee, iedereen is anoniem. Alleen jij weet wie jouw SOA&nbsp;Alarm heeft ontvangen.</p>\r\n<p><strong>Hoe weet ik dat iedereen mijn SOA&nbsp;Alarm ontvangen heeft</strong>?<br />\r\nBij het versturen krijg je een melding wie het SOA&nbsp;Alarm heeft ontvangen en bij wie het bericht niet is aangekomen. Twijfel je of iedereen jouw SOA&nbsp;Alarm gelezen heeft? De sociaalverpleegkundige van het GGD kan je bedpartners telefonisch en anoniem waarschuwen. Maak hier gebruik van om je waarschuwing extra kracht bij te zetten.<strong> </strong>Ga naar een van de GGD-SOA poliklinieken.</p>\r\n<p><strong>Wie moet ik allemaal waarschuwen?</strong><br />\r\nBij <a href=\"[wblink9]\">SOA&nbsp;overzicht</a> zie je per SOA&nbsp;een advies voor partnerwaarschuwing. Bij sommige SOA is het belangrijk om sekspartners van jaren geleden te waarschuwen. Kies altijd het zekere voor het onzekere en sluit niemand uit.</p>\r\n<p><strong>Ik weet nog niet zeker of ik een SOA&nbsp;heb, maar er is duidelijk iets mis.</strong><br />\r\nLaat je altijd checken bij een van de GGD-SOA  poliklinieken of je huisarts. Je kunt preventief een SOA Alarm versturen naar je bedpartners, zodat er geen tijd verloren gaat.</p>\r\n<p><strong>Ik heb niet van al mijn sekspartners de namen en/of e-mailadressen.</strong><br />\r\nHet kan best zijn dat je niet over de contactgegevens van je sekspartners beschikt. Met sociale netwerken als Facebook en&nbsp;Hyves kun je vrij gemakkelijk personen vinden, door bijvoorbeeld te zoeken op woonplaats en leeftijd of favoriete uitgaansgelegenheden. Mocht je ook op die manier niets kunnen vinden, dan kun proberen de persoon te vinden op de locatie waar je elkaar ontmoet hebt, bijvoorbeeld op de laatste zaterdagavond van de maand in de discotheek. Het klinkt misschien als overbodige moeite, maar onderschat het gevaar van een SOA voor jezelf en voor anderen niet.</p>\r\n<p><strong>Ik heb een SOA&nbsp;Alarm verstuurd, stopt hier mijn verantwoordelijkheid?</strong><br />\r\nJe hebt een belangrijke stap gemaakt door je bedpartners te waarschuwen, maar hier houdt het zeker niet op. Laat je altijd checken bij &eacute;&eacute;n van de GGD-SOA poliklinieken of je huisarts. Zij kunnen je verder helpen met partnerwaarschuwing, zodat je zeker weet dat iedereen zich laat controleren.</p>\r\n<p><strong>Hebben de initiatiefnemers zelf een SOA (gehad)?</strong><br />\r\nNee, maar als ze er een krijgen en het van belang is dat jij het weet, zullen ze je zeker waarschuwen.</p>\r\n<p><strong>Ik wil geen e-mails meer ontvangen van SOA&nbsp;Alarm!</strong><br />\r\nVul <a href=\"http://www.soaalarm.nl/blokkeren/\">hier</a> je e-mailadres in, dan wordt deze geblokkeerd van onze dienst.</p>','Veelgestelde vragen\r\nSOA Alarm is anoniem, waarom moet ik mijn e-mailadres opgeven?\r\nJe eigen e-mailadres wordt gevraagd ter verificatie om spam tegen te gaan.\r\n&nbsp;\r\nKan ik niet gewoon zelf een e-mail sturen?\r\nZeker weten. SOA Alarm is slechts een hulpmiddel die je de mogelijkheid biedt mensen anoniem op de hoogte te stellen, mocht dat gewenst zijn. Persoonlijk contact geniet nog altijd de voorkeur.\r\n&nbsp;\r\nIk heb een SOA&nbsp;Alarm ontvangen. Wat moet ik doen?\r\nNeem een  SOA&nbsp;Alarm altijd serieus. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts. Ook als je zelf (nog) geen klachten hebt. Waarschuw direct je sekspartners. Via SOA Alarm kan dat anoniem.\r\nIk heb een SOA&nbsp;Alarm ontvangen. Hoe weet ik zeker dat het geen  flauwe grap is?\r\nNeem een  SOA&nbsp;Alarm altijd serieus. Ook als  je zelf (nog) geen klachten  hebt. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nZien de bedpartners naar wie ik het SOA&nbsp;Alarm stuur elkaars e-mailadressen of namen?\r\nNee, iedereen is anoniem. Alleen jij weet wie jouw SOA&nbsp;Alarm heeft ontvangen.\r\nHoe weet ik dat iedereen mijn SOA&nbsp;Alarm ontvangen heeft?\r\nBij het versturen krijg je een melding wie het SOA&nbsp;Alarm heeft ontvangen en bij wie het bericht niet is aangekomen. Twijfel je of iedereen jouw SOA&nbsp;Alarm gelezen heeft? De sociaalverpleegkundige van het GGD kan je bedpartners telefonisch en anoniem waarschuwen. Maak hier gebruik van om je waarschuwing extra kracht bij te zetten. Ga naar een van de GGD-SOA poliklinieken.\r\nWie moet ik allemaal waarschuwen?\r\nBij SOA&nbsp;overzicht zie je per SOA&nbsp;een advies voor partnerwaarschuwing. Bij sommige SOA is het belangrijk om sekspartners van jaren geleden te waarschuwen. Kies altijd het zekere voor het onzekere en sluit niemand uit.\r\nIk weet nog niet zeker of ik een SOA&nbsp;heb, maar er is duidelijk iets mis.\r\nLaat je altijd checken bij een van de GGD-SOA  poliklinieken of je huisarts. Je kunt preventief een SOA Alarm versturen naar je bedpartners, zodat er geen tijd verloren gaat.\r\nIk heb niet van al mijn sekspartners de namen en/of e-mailadressen.\r\nHet kan best zijn dat je niet over de contactgegevens van je sekspartners beschikt. Met sociale netwerken als Facebook en&nbsp;Hyves kun je vrij gemakkelijk personen vinden, door bijvoorbeeld te zoeken op woonplaats en leeftijd of favoriete uitgaansgelegenheden. Mocht je ook op die manier niets kunnen vinden, dan kun proberen de persoon te vinden op de locatie waar je elkaar ontmoet hebt, bijvoorbeeld op de laatste zaterdagavond van de maand in de discotheek. Het klinkt misschien als overbodige moeite, maar onderschat het gevaar van een SOA voor jezelf en voor anderen niet.\r\nIk heb een SOA&nbsp;Alarm verstuurd, stopt hier mijn verantwoordelijkheid?\r\nJe hebt een belangrijke stap gemaakt door je bedpartners te waarschuwen, maar hier houdt het zeker niet op. Laat je altijd checken bij &eacute;&eacute;n van de GGD-SOA poliklinieken of je huisarts. Zij kunnen je verder helpen met partnerwaarschuwing, zodat je zeker weet dat iedereen zich laat controleren.\r\nHebben de initiatiefnemers zelf een SOA (gehad)?\r\nNee, maar als ze er een krijgen en het van belang is dat jij het weet, zullen ze je zeker waarschuwen.\r\nIk wil geen e-mails meer ontvangen van SOA&nbsp;Alarm!\r\nVul hier je e-mailadres in, dan wordt deze geblokkeerd van onze dienst.'),
	(7,7,'<h3>Over SoaAlarm.nl</h3>\r\n<p><strong>SOA&nbsp;Alarm is ge&iuml;nitieerd om het waarschuwen van bedpartners  gemakkelijker te maken, zodat iedereen tijdig naar de GGD of  huisarts verwezen kan worden.</strong></p>\r\n<p>Ieder jaar worden honderdduizend Nederlanders geconfronteerd met  een vervelende SOA. Sommige geslachtsziekten hebben zeer ernstige  gevolgen. G&ecirc;ne en taboe gaan hand in hand met SOA. Dit verhoogt de drempel voor het alarmeren van  bedpartners en is een direct gevaar voor de volksgezondheid.</p>\r\n<p>SOA Alarm wil de verspreiding van SOA  remmen en de gevolgen beperken.   Omdat  dit anoniem gebeurt mogen schaamte en religie geen argument meer   zijn  om te zwijgen.</p>\r\n<h4>Initiatief</h4>\r\n<p>Hoe vertel jij dat je een SOA hebt? Ooit werd in de televisieserie The Office op komische wijze duidelijk gemaakt hoe lastig dit is. Dat bracht ons bij het volgende idee: met honderdduizend besmettingen per jaar is er behoefte aan een makkelijke en moderne methode. Wat kunnen wij hier aan doen?<br />\r\n<br />\r\nHet realiseren van SOA Alarm. Een simpele en gerichte tool, waarmee je anoniem en zonder gezichtsverlies je intieme contacten kunt waarschuwen voor een mogelijke besmetting. SOA Alarm is een onafhankelijk initiatief.</p>\r\n<p>Hoewel het  gevaar van SOA bij de meeste mensen bekend is, blijft een  dergelijke aandoening toch vaak een taboe. Het is ook helemaal  niet  vreemd dat mensen zich schamen voor een geslachtsziekte. Ook dat  moet  gerespecteerd worden. Wij zien  dat een anoniem initiatief als SOA  Alarm nodig is om de  verspreiding  te remmen en de gevolgen te  beperken.<br />\r\n&nbsp;<br />\r\nHet herkennen van een maatschappelijk probleem is het zetten van de eerste stap. Hopelijk kunnen wij onze steen bijdragen door middel van SOA Alarm. <br />\r\n&nbsp;<br />\r\nWij zijn <a href=\"mailto:david@soaalarm.nl\">David van Driel</a>, <a href=\"mailto:jurrejan@soaalarm.nl\">Jurre-Jan Smit</a> en <a href=\"mailto:thomas@soaalarm.nl\">Thomas van Driel</a>.</p>\r\n<p><br />\r\n<a href=\"http://www.twitter.com/SOAalarm\"><img src=\"http://twitter-badges.s3.amazonaws.com/follow_us-b.png\" alt=\"Follow SOAalarm on Twitter\" /></a></p>','Over SoaAlarm.nl\r\nSOA&nbsp;Alarm is ge&iuml;nitieerd om het waarschuwen van bedpartners  gemakkelijker te maken, zodat iedereen tijdig naar de GGD of  huisarts verwezen kan worden.\r\nIeder jaar worden honderdduizend Nederlanders geconfronteerd met  een vervelende SOA. Sommige geslachtsziekten hebben zeer ernstige  gevolgen. G&ecirc;ne en taboe gaan hand in hand met SOA. Dit verhoogt de drempel voor het alarmeren van  bedpartners en is een direct gevaar voor de volksgezondheid.\r\nSOA Alarm wil de verspreiding van SOA  remmen en de gevolgen beperken.   Omdat  dit anoniem gebeurt mogen schaamte en religie geen argument meer   zijn  om te zwijgen.\r\nInitiatief\r\nHoe vertel jij dat je een SOA hebt? Ooit werd in de televisieserie The Office op komische wijze duidelijk gemaakt hoe lastig dit is. Dat bracht ons bij het volgende idee: met honderdduizend besmettingen per jaar is er behoefte aan een makkelijke en moderne methode. Wat kunnen wij hier aan doen?\r\n\r\nHet realiseren van SOA Alarm. Een simpele en gerichte tool, waarmee je anoniem en zonder gezichtsverlies je intieme contacten kunt waarschuwen voor een mogelijke besmetting. SOA Alarm is een onafhankelijk initiatief.\r\nHoewel het  gevaar van SOA bij de meeste mensen bekend is, blijft een  dergelijke aandoening toch vaak een taboe. Het is ook helemaal  niet  vreemd dat mensen zich schamen voor een geslachtsziekte. Ook dat  moet  gerespecteerd worden. Wij zien  dat een anoniem initiatief als SOA  Alarm nodig is om de  verspreiding  te remmen en de gevolgen te  beperken.\r\n&nbsp;\r\nHet herkennen van een maatschappelijk probleem is het zetten van de eerste stap. Hopelijk kunnen wij onze steen bijdragen door middel van SOA Alarm. \r\n&nbsp;\r\nWij zijn David van Driel, Jurre-Jan Smit en Thomas van Driel.\r\n\r\n'),
	(9,9,'<h3><strong>Overzicht</strong></h3>\r\n<p>Seksueel Overdraagbare Aandoeningen zijn niet altijd gemakkelijk te herkennen. Soms doen zich helemaal geen klachten voor, terwijl je de SOA&nbsp;wel bij je draagt. Algemene klachten zijn afscheiding, een branderig gevoel, zweertjes of wratjes, jeuk en pijn.</p>\r\n<p>Denk je een SOA te hebben?&nbsp;Zoek direct medische hulp en waarschuw je bedpartners. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>','Overzicht\r\nSeksueel Overdraagbare Aandoeningen zijn niet altijd gemakkelijk te herkennen. Soms doen zich helemaal geen klachten voor, terwijl je de SOA&nbsp;wel bij je draagt. Algemene klachten zijn afscheiding, een branderig gevoel, zweertjes of wratjes, jeuk en pijn.\r\nDenk je een SOA te hebben?&nbsp;Zoek direct medische hulp en waarschuw je bedpartners. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.'),
	(10,10,'<h3>Chlamydia</h3>\r\n<p>Chlamydia is de meest voorkomende SOA&nbsp;in Nederland. Deze vervelende infectie wordt veroorzaakt door een bacterie die zich nestelt in de geslachtsdelen. Gelukkig is chlamydia eenvoudig te genezen door middel van antibiotica. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Afscheiding</li>\r\n    <li>Branderig gevoel bij het plassen</li>\r\n    <li>Bloedverlies</li>\r\n    <li>Pijn in de onderbuik</li>\r\n    <li>Jeuk of pijn rond de anus</li>\r\n</ul>\r\n<h4>Gevolgen</h4>\r\n<ul>\r\n    <li>Eileiderontsteking</li>\r\n    <li>Bekkenontsteking</li>\r\n    <li>Koorts</li>\r\n    <li>Hevige pijn in de (onder)buik</li>\r\n    <li>Onvruchtbaarheid</li>\r\n    <li>Bijbalontsteking</li>\r\n    <li>Zwelling in de balzak</li>\r\n</ul>\r\n<h4>SOA Alarm</h4>\r\n<p>Het is belangrijk dat alle sekspartners uit de zes weken voorafgaand aan  de klachten op de hoogte worden gebracht en zich laten testen bij een  van de GGD-SOA poliklinieken of de huisarts. In het geval dat er geen  klachten zijn, waarschuw dan alle partners van de laatste zes maanden.</p>','Chlamydia\r\nChlamydia is de meest voorkomende SOA&nbsp;in Nederland. Deze vervelende infectie wordt veroorzaakt door een bacterie die zich nestelt in de geslachtsdelen. Gelukkig is chlamydia eenvoudig te genezen door middel van antibiotica. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Afscheiding\r\n    Branderig gevoel bij het plassen\r\n    Bloedverlies\r\n    Pijn in de onderbuik\r\n    Jeuk of pijn rond de anus\r\n\r\nGevolgen\r\n\r\n    Eileiderontsteking\r\n    Bekkenontsteking\r\n    Koorts\r\n    Hevige pijn in de (onder)buik\r\n    Onvruchtbaarheid\r\n    Bijbalontsteking\r\n    Zwelling in de balzak\r\n\r\nSOA Alarm\r\nHet is belangrijk dat alle sekspartners uit de zes weken voorafgaand aan  de klachten op de hoogte worden gebracht en zich laten testen bij een  van de GGD-SOA poliklinieken of de huisarts. In het geval dat er geen  klachten zijn, waarschuw dan alle partners van de laatste zes maanden.'),
	(11,11,'<h3>Genitale Wratten</h3>\r\n<p>De vervelende wratjes rond de geslachtsdelen zijn gelukkig onschuldig. Genitale wratten ontstaan enkele weken tot maanden na het in aanraking komen met het virus. Ook na behandeling kan iemand het virus nog overdragen aan andere mensen.. De wratten worden veroorzaakt door een virus dat wordt overgedragen tijdens lichamelijk contact, ook als dit indirect is door bijvoorbeeld het afdrogen met dezelfde handdoek. Sommige wratten verdwijnen spontaan; een arts kan een cr&egrave;me of vloeistof voorschrijven ter behandeling. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Wratten rond de geslachtsdelen, balzak of anus</li>\r\n    <li>Inwendige wratten</li>\r\n    <li>Jeuk of pijn</li>\r\n    <li>Branderig gevoel</li>\r\n</ul>','Genitale Wratten\r\nDe vervelende wratjes rond de geslachtsdelen zijn gelukkig onschuldig. Genitale wratten ontstaan enkele weken tot maanden na het in aanraking komen met het virus. Ook na behandeling kan iemand het virus nog overdragen aan andere mensen.. De wratten worden veroorzaakt door een virus dat wordt overgedragen tijdens lichamelijk contact, ook als dit indirect is door bijvoorbeeld het afdrogen met dezelfde handdoek. Sommige wratten verdwijnen spontaan; een arts kan een cr&egrave;me of vloeistof voorschrijven ter behandeling. Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Wratten rond de geslachtsdelen, balzak of anus\r\n    Inwendige wratten\r\n    Jeuk of pijn\r\n    Branderig gevoel\r\n'),
	(12,12,'<h3>Gonorroe</h3>\r\n<p>De zeer vervelende aandoening gonorroe is heel besmettelijk.&nbsp;In de volksmond wordt deze SOA&nbsp;ook wel een \'druiper\' genoemd. Ook via de ogen en de neus kan deze ziekte zich verspreiden. Gelukkig is het goed te behandelen met antibiotica. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Vaginale afscheiding</li>\r\n    <li>Onaangename geur of kleur van de geslachtsdelen</li>\r\n    <li>Bloedverlies</li>\r\n    <li>Pijn bij het plassen</li>\r\n    <li>Branderig gevoel</li>\r\n    <li>Irritatie in de anus</li>\r\n    <li>Keelontsteking</li>\r\n    <li>Opgezette klieren (in de hals)</li>\r\n    <li>Ontstoken gewrichten</li>\r\n</ul>\r\n<h4>Gevolgen</h4>\r\n<ul>\r\n    <li>Eileiderontsteking</li>\r\n    <li>Koorts</li>\r\n    <li>Onvruchtbaarheid</li>\r\n    <li>Prostaat- of bijbalontsteking</li>\r\n    <li>Zwelling en heftige pijn in de balzak</li>\r\n    <li>Moeizaam en pijnlijk plassen</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Het is belangrijk dat alle sekspartners uit de zes weken voorafgaand aan de klachten op de hoogte worden gebracht en zich laten testen bij een van de GGD-SOA poliklinieken of de huisarts. In het geval dat er geen klachten zijn, waarschuw dan alle partners van de laatste zes maanden.</p>','Gonorroe\r\nDe zeer vervelende aandoening gonorroe is heel besmettelijk.&nbsp;In de volksmond wordt deze SOA&nbsp;ook wel een \'druiper\' genoemd. Ook via de ogen en de neus kan deze ziekte zich verspreiden. Gelukkig is het goed te behandelen met antibiotica. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Vaginale afscheiding\r\n    Onaangename geur of kleur van de geslachtsdelen\r\n    Bloedverlies\r\n    Pijn bij het plassen\r\n    Branderig gevoel\r\n    Irritatie in de anus\r\n    Keelontsteking\r\n    Opgezette klieren (in de hals)\r\n    Ontstoken gewrichten\r\n\r\nGevolgen\r\n\r\n    Eileiderontsteking\r\n    Koorts\r\n    Onvruchtbaarheid\r\n    Prostaat- of bijbalontsteking\r\n    Zwelling en heftige pijn in de balzak\r\n    Moeizaam en pijnlijk plassen\r\n\r\nSOA&nbsp;Alarm\r\nHet is belangrijk dat alle sekspartners uit de zes weken voorafgaand aan de klachten op de hoogte worden gebracht en zich laten testen bij een van de GGD-SOA poliklinieken of de huisarts. In het geval dat er geen klachten zijn, waarschuw dan alle partners van de laatste zes maanden.'),
	(13,13,'<h3>Hepatitis B</h3>\r\n<p>Het virus Hepatitis B is een infectie van de lever. Op langer termijn kan deze infecte blijvende schade veroorzaken, en in het ergste geval kanker in de lever. Hepatitis B&nbsp;is een zeer besmettelijke SOA, maar heeft niet altijd duidelijke symptonen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Vermoeidheid</li>\r\n    <li>Verhoging of koorts</li>\r\n    <li>Spier- en gewrichtspijn</li>\r\n    <li>Lusteloosheid</li>\r\n    <li>Misselijkheid</li>\r\n    <li>Pijn in de bovenbuik</li>\r\n    <li>Huidafwijkingen</li>\r\n</ul>\r\n<h4>Gevolgen</h4>\r\n<ul>\r\n    <li>Geelzucht</li>\r\n    <li>Donkere urine</li>\r\n    <li>Ontstoken lever</li>\r\n    <li>Leverkanker</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose. Ook anderen uit de leefomgeving die mogelijk risico hebben gelopen, zoals huisgenoten of personen met wie drugsattributen gedeeld zijn, moeten worden getest.</p>','Hepatitis B\r\nHet virus Hepatitis B is een infectie van de lever. Op langer termijn kan deze infecte blijvende schade veroorzaken, en in het ergste geval kanker in de lever. Hepatitis B&nbsp;is een zeer besmettelijke SOA, maar heeft niet altijd duidelijke symptonen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Vermoeidheid\r\n    Verhoging of koorts\r\n    Spier- en gewrichtspijn\r\n    Lusteloosheid\r\n    Misselijkheid\r\n    Pijn in de bovenbuik\r\n    Huidafwijkingen\r\n\r\nGevolgen\r\n\r\n    Geelzucht\r\n    Donkere urine\r\n    Ontstoken lever\r\n    Leverkanker\r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose. Ook anderen uit de leefomgeving die mogelijk risico hebben gelopen, zoals huisgenoten of personen met wie drugsattributen gedeeld zijn, moeten worden getest.'),
	(14,14,'<h3>Herpes</h3>\r\n<p>Een pijnlijke infectie van de huid en/of slijmvliezen rond de genitali&euml;n. Het herpes-virus kan overal op je lichaam terecht komen, door seks of lichamelijk contact. Herpes is niet te genezen, maar de klachten en verschijnselen van herpes kunnen worden behandeld. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Jeuk</li>\r\n    <li>Branderig gevoel</li>\r\n    <li>Rode plekjes</li>\r\n    <li>Blaasjes of zweertjes</li>\r\n    <li>Koorts</li>\r\n    <li>Afscheiding</li>\r\n    <li>Pijn bij het plassen</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.</p>','Herpes\r\nEen pijnlijke infectie van de huid en/of slijmvliezen rond de genitali&euml;n. Het herpes-virus kan overal op je lichaam terecht komen, door seks of lichamelijk contact. Herpes is niet te genezen, maar de klachten en verschijnselen van herpes kunnen worden behandeld. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Jeuk\r\n    Branderig gevoel\r\n    Rode plekjes\r\n    Blaasjes of zweertjes\r\n    Koorts\r\n    Afscheiding\r\n    Pijn bij het plassen\r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.'),
	(15,15,'<h3>HIV</h3>\r\n<p>E&eacute;n van de gevaarlijkste SOA is HIV. Het virus staat vooral bekend als de veroorzaker van aids. Dit virus tast het afweersysteem aan, waardoor het lichaam minder goed weerbaar is tegen allerlei ziektes. Wie een HIV-infectie oploopt is niet altijd gelijk ziek. Het kan jaren duren voordat klachten zich voordoen. Herken je de klachten? Ga naar een van de GGD-SOA  poliklinieken of naar  je huisarts.</p>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Een HIV-infectie is een zeer ernstige soa. Waarschuw al je sekspartners uit het verleden, ongeacht of zij wel of geen klachten hebben. Zoek direct medische hulp.</p>','HIV\r\nE&eacute;n van de gevaarlijkste SOA is HIV. Het virus staat vooral bekend als de veroorzaker van aids. Dit virus tast het afweersysteem aan, waardoor het lichaam minder goed weerbaar is tegen allerlei ziektes. Wie een HIV-infectie oploopt is niet altijd gelijk ziek. Het kan jaren duren voordat klachten zich voordoen. Herken je de klachten? Ga naar een van de GGD-SOA  poliklinieken of naar  je huisarts.\r\nSOA&nbsp;Alarm\r\nEen HIV-infectie is een zeer ernstige soa. Waarschuw al je sekspartners uit het verleden, ongeacht of zij wel of geen klachten hebben. Zoek direct medische hulp.'),
	(16,16,'<h3>Syfilis</h3>\r\n<p>Syfilis is een zeer ernstige SOA. De geslachtsziekte syfilis wordt veroorzaakt door een  lastige bacterie. De ziekte is te genezen als je er op tijd achter komt,  anders kan syfilis zich door je bloedbaan verspreiden. Herken je de  klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Zweertjes</li>\r\n    <li>Opgezette lymfeklieren</li>\r\n    <li>Vlekjes op de huid</li>\r\n    <li>Grieperig gevoel</li>\r\n    <li>Haaruitval</li>\r\n    <li>Oogklachten</li>\r\n    <li>Wratjes</li>\r\n</ul>\r\n<h4>Gevolgen</h4>\r\n<ul>\r\n    <li>Beschadigde organen</li>\r\n    <li>Hersenbeschadiging</li>\r\n    <li>Ontstoken botten</li>\r\n    <li>Verlamming</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw minimaal je sekspartners uit de laatste twee jaar. Het is van belang dat  je eventuele vaste partner en eventueel ook je kinderen worden  onderzocht.</p>','Syfilis\r\nSyfilis is een zeer ernstige SOA. De geslachtsziekte syfilis wordt veroorzaakt door een  lastige bacterie. De ziekte is te genezen als je er op tijd achter komt,  anders kan syfilis zich door je bloedbaan verspreiden. Herken je de  klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Zweertjes\r\n    Opgezette lymfeklieren\r\n    Vlekjes op de huid\r\n    Grieperig gevoel\r\n    Haaruitval\r\n    Oogklachten\r\n    Wratjes\r\n\r\nGevolgen\r\n\r\n    Beschadigde organen\r\n    Hersenbeschadiging\r\n    Ontstoken botten\r\n    Verlamming\r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw minimaal je sekspartners uit de laatste twee jaar. Het is van belang dat  je eventuele vaste partner en eventueel ook je kinderen worden  onderzocht.'),
	(19,19,'<h3>Schurft</h3>\r\n<p>Jeuk, jeuk, jeuk en nog eens jeuk. Schurft is een irritante SOA&nbsp;die wordt veroorzaakt door de schurftmijt. Het kleine beestje graaft gangetjes in de huid en legt daar haar eitjes. Gelukkig is het beestje niet gevaarlijke en is schurft vrij gemakkelijk te behandelen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts. <strong> </strong></p>\r\n<h4><strong>Klachten</strong></h4>\r\n<p><strong> </strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n    <li>Jeuk</li>\r\n    <li>Roodpaarse bultjes rondom geslacht<strong><br />\r\n    </strong></li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.</p>','Schurft\r\nJeuk, jeuk, jeuk en nog eens jeuk. Schurft is een irritante SOA&nbsp;die wordt veroorzaakt door de schurftmijt. Het kleine beestje graaft gangetjes in de huid en legt daar haar eitjes. Gelukkig is het beestje niet gevaarlijke en is schurft vrij gemakkelijk te behandelen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.  \r\nKlachten\r\n \r\n&nbsp;\r\n\r\n    Jeuk\r\n    Roodpaarse bultjes rondom geslacht\r\n    \r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.'),
	(20,20,'<h3>Schaamluis</h3>\r\n<p>Schaamluizen (platjes) zijn vervelende, maar ongevaarlijke parasieten, die meestal door lichamelijk contact worden overgebracht. Schaamluizen zijn vrij gemakkelijk te bestrijden met speciale bestrijdingsmiddelen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Jeuk</li>\r\n    <li>Rode of bruine ontlasting van de luizen</li>\r\n    <li>Grijsblauwe plekjes op de huid</li>\r\n    <li>Ge&iuml;rriteerde huid</li>\r\n    <li>Huidinfecties</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.</p>','Schaamluis\r\nSchaamluizen (platjes) zijn vervelende, maar ongevaarlijke parasieten, die meestal door lichamelijk contact worden overgebracht. Schaamluizen zijn vrij gemakkelijk te bestrijden met speciale bestrijdingsmiddelen. Herken je de klachten? Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Jeuk\r\n    Rode of bruine ontlasting van de luizen\r\n    Grijsblauwe plekjes op de huid\r\n    Ge&iuml;rriteerde huid\r\n    Huidinfecties\r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw bij voorkeur al je sekspartners, maar minimaal tot een  halfjaar voor de klachten/diagnose.'),
	(21,21,'<h3>Trichomoniasis</h3>\r\n<p>Trichomoniasis is een seksueel overdraagbare aandoening (SOA), veroorzaakt door een parasiet. De infectie is goed te behandelen en heeft zelden ernstige gevolgen. Herken je de klachten?Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.</p>\r\n<h4>Klachten</h4>\r\n<ul>\r\n    <li>Ontstoken geslachtsdelen</li>\r\n    <li>Onaangenaam geurende afscheiding</li>\r\n    <li>Schuimende afscheiding</li>\r\n    <li>Ge&iuml;rriteerde schaamlippen</li>\r\n    <li>Pijn bij het plassen</li>\r\n    <li>Ontstoken plasbuis</li>\r\n    <li>Ge&iuml;rriteerde eikel&nbsp;</li>\r\n</ul>\r\n<h4>Gevolgen</h4>\r\n<ul>\r\n    <li>Verhoogd risico op HIV</li>\r\n    <li>Problemen tijdens zwangerschap</li>\r\n</ul>\r\n<h4>SOA&nbsp;Alarm</h4>\r\n<p>Waarschuw minimaal je sekspartners uit de laatste vier weken, ongeacht of zij wel of geen klachten hebben.</p>','Trichomoniasis\r\nTrichomoniasis is een seksueel overdraagbare aandoening (SOA), veroorzaakt door een parasiet. De infectie is goed te behandelen en heeft zelden ernstige gevolgen. Herken je de klachten?Ga naar een van de GGD-SOA poliklinieken of naar  je huisarts.\r\nKlachten\r\n\r\n    Ontstoken geslachtsdelen\r\n    Onaangenaam geurende afscheiding\r\n    Schuimende afscheiding\r\n    Ge&iuml;rriteerde schaamlippen\r\n    Pijn bij het plassen\r\n    Ontstoken plasbuis\r\n    Ge&iuml;rriteerde eikel&nbsp;\r\n\r\nGevolgen\r\n\r\n    Verhoogd risico op HIV\r\n    Problemen tijdens zwangerschap\r\n\r\nSOA&nbsp;Alarm\r\nWaarschuw minimaal je sekspartners uit de laatste vier weken, ongeacht of zij wel of geen klachten hebben.'),
	(22,22,'<h3>Een SOA&nbsp;Alarm versturen</h3>\r\n<p><strong>Stap 1. </strong>Druk op \'<a href=\"http://www.soaalarm.nl/verstuur-een-soa-alarm/\">verstuur een alarm</a>\'.</p>\r\n<p><strong>Stap 2. </strong>Vul de gegevens in. Je eigen e-mailadres wordt gevraagd ter verificatie om spam tegen te gaan. Je blijft anoniem.</p>\r\n<p>Selecteer de SOA en vul &eacute;&eacute;n of meerdere ontvangadressen in. Het is soms lastig te bepalen vanaf welk moment je bent besmet. Sluit daarom niemand uit.</p>\r\n<p><strong>Stap 3. </strong>Je ontvangt een e-mail met een bevestigingscode.</p>\r\n<script>\r\n	$(document).ready(function(){\r\n		$(\"#preview\").fancybox({\r\n			\'width\'				: 800,\r\n			\'height\'			: \'90%\',\r\n	        \'autoScale\'     	: false,\r\n	        \'transitionIn\'		: \'none\',\r\n			\'transitionOut\'		: \'none\',\r\n			\'type\'				: \'iframe\'\r\n		});\r\n	});\r\n</script>\r\n<p><strong>Stap 4. </strong>Vul de bevestigingscode in en verstuur het SOA&nbsp;Alarm.<br />\r\nBekijk een <a id=\"preview\" href=\"/preview/\">voorbeeld</a> van de SOA&nbsp;Alarm e-mail die jouw bedpartners ontvangen.</p>\r\n<p><strong>Verzonden!</strong><br />\r\nDe e-mailadressen die jij hebt opgegeven hebben nu een SOA&nbsp;Alarm  ontvangen.<br />\r\nOptioneel kun je nu het anonieme onderzoek invullen.</p>','Een SOA&nbsp;Alarm versturen\r\nStap 1. Druk op \'verstuur een alarm\'.\r\nStap 2. Vul de gegevens in. Je eigen e-mailadres wordt gevraagd ter verificatie om spam tegen te gaan. Je blijft anoniem.\r\nSelecteer de SOA en vul &eacute;&eacute;n of meerdere ontvangadressen in. Het is soms lastig te bepalen vanaf welk moment je bent besmet. Sluit daarom niemand uit.\r\nStap 3. Je ontvangt een e-mail met een bevestigingscode.\r\n\r\n	$(document).ready(function(){\r\n		$(\"#preview\").fancybox({\r\n			\'width\'				: 800,\r\n			\'height\'			: \'90%\',\r\n	        \'autoScale\'     	: false,\r\n	        \'transitionIn\'		: \'none\',\r\n			\'transitionOut\'		: \'none\',\r\n			\'type\'				: \'iframe\'\r\n		});\r\n	});\r\n\r\nStap 4. Vul de bevestigingscode in en verstuur het SOA&nbsp;Alarm.\r\nBekijk een voorbeeld van de SOA&nbsp;Alarm e-mail die jouw bedpartners ontvangen.\r\nVerzonden!\r\nDe e-mailadressen die jij hebt opgegeven hebben nu een SOA&nbsp;Alarm  ontvangen.\r\nOptioneel kun je nu het anonieme onderzoek invullen.'),
	(42,40,'<h3>Misbruik melden</h3>\r\n<p>Neem een melding van SOA&nbsp;Alarm hoe dan ook serieus en laat je altijd checken.<br />\r\nHeb je het sterk het vermoeden dat er bij jou misbruik is gemaakt van SOA&nbsp;Alarm?&nbsp;<br />\r\nMeld dit dan via het <a href=\"http://www.soaalarm.nl/over-soa-alarm/contact/\">contactformulier</a>.</p>','Misbruik melden\r\nNeem een melding van SOA&nbsp;Alarm hoe dan ook serieus en laat je altijd checken.\r\nHeb je het sterk het vermoeden dat er bij jou misbruik is gemaakt van SOA&nbsp;Alarm?&nbsp;\r\nMeld dit dan via het contactformulier.'),
	(32,31,'<p>Tips hoe je e-mailadressen van sekspartners kunt verzamelen. Bijvoorbeeld: kijk op de social media.</p>','Tips hoe je e-mailadressen van sekspartners kunt verzamelen. Bijvoorbeeld: kijk op de social media.'),
	(34,33,'<h3><strong>Voor iedereen</strong></h3>\r\n<p>Seksueel Overdraagbare Aandoeningen kunnen bij iedereen voorkomen: mannen en vrouwen, hetero\'s en homo\'s, jong en oud. Iedereen met een actief seksleven loopt een potentieel risico.<br />\r\n<br />\r\nSOA&nbsp;Alarm is voor iedereen die (vermoedelijk) een SOA heeft en de afgelopen jaren &eacute;&eacute;n of meer sekspartners heeft gehad. De boodschap is duidelijk: rem de verspreiding van SOA en beperk de gevolgen voor je bedpartners!</p>','Voor iedereen\r\nSeksueel Overdraagbare Aandoeningen kunnen bij iedereen voorkomen: mannen en vrouwen, hetero\'s en homo\'s, jong en oud. Iedereen met een actief seksleven loopt een potentieel risico.\r\n\r\nSOA&nbsp;Alarm is voor iedereen die (vermoedelijk) een SOA heeft en de afgelopen jaren &eacute;&eacute;n of meer sekspartners heeft gehad. De boodschap is duidelijk: rem de verspreiding van SOA en beperk de gevolgen voor je bedpartners!'),
	(35,34,'<p>Screenshot of video met toelichtingen van de mail en resultaatpagina die geadresseerden krijgen.</p>','Screenshot of video met toelichtingen van de mail en resultaatpagina die geadresseerden krijgen.'),
	(37,36,'<h3>Waarom</h3>\r\n<p>Rondlopen met een vervelende SOA, maar je doodschamen om je bedpartners in te lichten is voor &eacute;&eacute;n op de vijf Nederlanders een pijnlijk herkenbare situatie. Schaamte, reputatie en religie zijn bekende argumenten van mensen die verzuimen hun seksuele contacten te alarmeren bij het gevaar van een geslachtziekte. Maar niet zonder gevaar: SOA die te laat ontdekt worden, kunnen ernstige gevolgen krijgen.</p>\r\n<p>SOA&nbsp;Alarm hoopt de verspreiding van geslachtziektes te remmen en partnerwaarschuwing een boost te geven. Want dat is hard nodig.</p>\r\n<h4>Doe het nu!</h4>\r\n<p>Waarschuw zo snel mogelijk je bedpartners. Sluit niemand uit!&nbsp;Geef iedereen de kans om zich tijdig te laten checken bij een GGD&nbsp;of huisarts. Met SOA&nbsp;Alarm kun je direct en anoniem laten weten dat je een SOA&nbsp;hebt - geen reden meer om te wachten.</p>','Waarom\r\nRondlopen met een vervelende SOA, maar je doodschamen om je bedpartners in te lichten is voor &eacute;&eacute;n op de vijf Nederlanders een pijnlijk herkenbare situatie. Schaamte, reputatie en religie zijn bekende argumenten van mensen die verzuimen hun seksuele contacten te alarmeren bij het gevaar van een geslachtziekte. Maar niet zonder gevaar: SOA die te laat ontdekt worden, kunnen ernstige gevolgen krijgen.\r\nSOA&nbsp;Alarm hoopt de verspreiding van geslachtziektes te remmen en partnerwaarschuwing een boost te geven. Want dat is hard nodig.\r\nDoe het nu!\r\nWaarschuw zo snel mogelijk je bedpartners. Sluit niemand uit!&nbsp;Geef iedereen de kans om zich tijdig te laten checken bij een GGD&nbsp;of huisarts. Met SOA&nbsp;Alarm kun je direct en anoniem laten weten dat je een SOA&nbsp;hebt - geen reden meer om te wachten.'),
	(39,37,'<h3>Privacybeleid</h3>\r\n<p>Met SOA&nbsp;Alarm blijf je altijd anoniem. Wanneer je  jouw bericht naar  meerdere personen stuurt, zien de ontvangers dat niet. Wanneer je een SOA&nbsp;Alarm verstuurt  vragen we bovendien g&eacute;&eacute;n persoonsgegevens. Op deze manier doen we er  alles aan om jouw privacy, en die van je bedpartners te bewaren.<br />\r\n<br />\r\nOm SOA&nbsp;Alarm verder te kunnen ontwikkelen en statistieken te kunnen  meten vragen we jouw feedback. Dat kan je anoniem doen door na het  versturen van het SOA&nbsp;Alarm mee te werken aan het onderzoek.</p>\r\n<p>SOA&nbsp;Alarm respecteert de privacy van alle gebruikers van haar site en draagt er zorg voor dat de persoonlijke informatie die u ons verschaft altijd vertrouwelijk wordt behandeld.  Wij gebruiken uw gegevens alleen om diensten waar u om gevraagd heeft te voldoen.</p>\r\n<h4>Cookies</h4>\r\n<p>De <a title=\"\" target=\"_blank\" href=\"http://www.doubleclick.com/privacy/faq.aspx\">DoubleClick DART-cookie</a> wordt door Google gebruikt in de  advertenties die worden  weergegeven op websites van uitgevers die advertenties van AdSense voor inhoud  weergeven. Als gebruikers de website van een AdSense-uitgever bezoeken en een  advertentie weergeven of erop klikken, kan er een cookie worden geplaatst in de  browser van die eindgebruiker. De gegevens die met deze cookies worden verzameld, worden gebruikt om AdSense-uitgevers te helpen de advertenties op hun sites en op internet beter weer te geven en te beheren.</p>\r\n<ul>\r\n    <li>Als externe leverancier maakt Google gebruik van cookies om advertenties op deze website weer te geven.</li>\r\n    <li>Met de DART-cookie kan Google advertenties weergeven aan gebruikers op basis van bezoek aan deze en andere sites op internet.</li>\r\n    <li>Gebruikers kunnen zich afmelden voor het gebruik van de DART-cookie door naar het privacybeleid van het advertentie- en inhoudsnetwerk van Google te gaan</li>\r\n</ul>','Privacybeleid\r\nMet SOA&nbsp;Alarm blijf je altijd anoniem. Wanneer je  jouw bericht naar  meerdere personen stuurt, zien de ontvangers dat niet. Wanneer je een SOA&nbsp;Alarm verstuurt  vragen we bovendien g&eacute;&eacute;n persoonsgegevens. Op deze manier doen we er  alles aan om jouw privacy, en die van je bedpartners te bewaren.\r\n\r\nOm SOA&nbsp;Alarm verder te kunnen ontwikkelen en statistieken te kunnen  meten vragen we jouw feedback. Dat kan je anoniem doen door na het  versturen van het SOA&nbsp;Alarm mee te werken aan het onderzoek.\r\nSOA&nbsp;Alarm respecteert de privacy van alle gebruikers van haar site en draagt er zorg voor dat de persoonlijke informatie die u ons verschaft altijd vertrouwelijk wordt behandeld.  Wij gebruiken uw gegevens alleen om diensten waar u om gevraagd heeft te voldoen.\r\nCookies\r\nDe DoubleClick DART-cookie wordt door Google gebruikt in de  advertenties die worden  weergegeven op websites van uitgevers die advertenties van AdSense voor inhoud  weergeven. Als gebruikers de website van een AdSense-uitgever bezoeken en een  advertentie weergeven of erop klikken, kan er een cookie worden geplaatst in de  browser van die eindgebruiker. De gegevens die met deze cookies worden verzameld, worden gebruikt om AdSense-uitgevers te helpen de advertenties op hun sites en op internet beter weer te geven en te beheren.\r\n\r\n    Als externe leverancier maakt Google gebruik van cookies om advertenties op deze website weer te geven.\r\n    Met de DART-cookie kan Google advertenties weergeven aan gebruikers op basis van bezoek aan deze en andere sites op internet.\r\n    Gebruikers kunnen zich afmelden voor het gebruik van de DART-cookie door naar het privacybeleid van het advertentie- en inhoudsnetwerk van Google te gaan\r\n'),
	(55,48,'<h3>Anoniem onderzoek</h3>\r\n<p>Met behulp van jou en vele andere gebruikers van SOA Alarm kunnen seksueel overdraagbare aandoeningen in de Nederlandse maatschappij beter in kaart worden gebracht. Hier zullen wij regelmatig over publiceren. Je bent niet verplicht om alle vragen te beantwoorden. Het onderzoek is geheel anoniem, jouw antwoorden worden gecombineerd met die van de andere respondenten.<br />\r\n&nbsp;</p>','Anoniem onderzoek\r\nMet behulp van jou en vele andere gebruikers van SOA Alarm kunnen seksueel overdraagbare aandoeningen in de Nederlandse maatschappij beter in kaart worden gebracht. Hier zullen wij regelmatig over publiceren. Je bent niet verplicht om alle vragen te beantwoorden. Het onderzoek is geheel anoniem, jouw antwoorden worden gecombineerd met die van de andere respondenten.\r\n&nbsp;'),
	(56,49,'<h3>Oeps!</h3>\r\n<p>De opgevraagde pagina kan niet worden gevonden.</p>\r\n<p>Je hebt op een link geklikt die niet meer geldig is of een verkeerd adres getypt. Sommige internetadressen zijn hoofdlettergevoelig.<br />\r\n<a href=\"http://www.soaalarm.nl\">Keer terug naar de startpagina.</a></p>','Oeps!\r\nDe opgevraagde pagina kan niet worden gevonden.\r\nJe hebt op een link geklikt die niet meer geldig is of een verkeerd adres getypt. Sommige internetadressen zijn hoofdlettergevoelig.\r\nKeer terug naar de startpagina.'),
	(68,50,'<h3>Contact</h3>\r\n<p>Voor vragen of informatie kun je ons bereiken via het onderstaande formulier. We zullen je bericht zo snel mogelijk in behandeling nemen. Zie ook de <a target=\"_self\" href=\"http://www.soaalarm.nl/zo-werkt-het/faq/\">veelgestelde vragen</a>.<br />\r\n&nbsp;</p>','Contact\r\nVoor vragen of informatie kun je ons bereiken via het onderstaande formulier. We zullen je bericht zo snel mogelijk in behandeling nemen. Zie ook de veelgestelde vragen.\r\n&nbsp;'),
	(70,58,'<p>Amsterdam, 16 maart 2011<br />\r\n&nbsp;</p>\r\n<h3>Waarschuw vanaf nu anoniem je bedpartners via SoaAlarm.nl</h3>\r\n<p><span style=\"line-height: 115%;\">Rondlopen met een vervelende SOA, maar je doodschamen om je bedpartners in te lichten - voor bijna een miljoen Nederlanders</span><span style=\"font-size: 11pt; line-height: 115%; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: rgb(153, 153, 153);\">&sup1;</span><span style=\"line-height: 115%;\"> is dit een pijnlijk herkenbare situatie. Schaamte, reputatie en religie zijn bekende argumenten van mensen die verzuimen hun intieme contacten te alarmeren bij het gevaar van een geslachtziekte. Maar niet zonder gevolgen: SOA die te laat ontdekt worden, kunnen een lelijk staartje krijgen!<br />\r\n<br />\r\nOp de website SoaAlarm.nl kun je vanaf vandaag gratis en anoniem je bedpartners waarschuwen voor de geslachtsziekte die ze mogelijk hebben opgelopen. Ontvang je een discrete e-mail van SOA Alarm? Dan krijg je direct belangrijke informatie over de geslachtsziekte, kun je zelf mensen inlichten en word je bovenal direct geadviseerd naar GGD of huisarts te gaan voor onderzoek en eventuele behandeling.<br />\r\n<br />\r\nIn Nederland lopen jaarlijks zo&rsquo;n honderdduizend mensen een SOA op. </span><span style=\"line-height: 115%;\">Onderzoek</span><span style=\"font-size: 11pt; line-height: 115%; color: rgb(102, 102, 102);\">&sup2;</span><span style=\"line-height: 115%;\"> wijst uit dat</span><span style=\"line-height: 115%;\"> 51% van de jongens zijn bedpartners niet over hun SOA vertelt. Vooral jongeren en studenten lopen een groot risico op een SOA omdat ze veel kortdurende relaties hebben en lang niet altijd een condoom gebruiken. Verder worden mannen die seks hebben met mannen en 50-plussers oververtegenwoordigd in de statistieken. Chlamydia, gonorroe en herpes komen bij deze gevarengroepen het meeste voor.<br />\r\n<br />\r\nHet onafhankelijke SOA Alarm verwacht dit jaar minimaal 10.000 meldingen te versturen. SOA Alarm hoopt met dit initiatief de verspreiding van SOA te remmen en partnerwaarschuwing een boost te geven. Want dat is hard nodig.</span></p>\r\n<p><span style=\"line-height: 115%;\"><a href=\"http://www.soaalarm.nl/media/logo_soa_alarm.png\" target=\"_blank\">Download het logo</a><br style=\"\" />\r\n</span><span style=\"line-height: 115%;\"><br />\r\n</span><br />\r\n<a data-via=\"SOAalarm\" data-count=\"horizontal\" data-text=\"Nieuw: waarschuw vanaf nu anoniem je bedpartners via SoaAlarm.nl\" data-url=\"http://www.soaalarm.nl/lancering-soa-alarm/\" class=\"twitter-share-button\" href=\"http://twitter.com/share\">Tweet</a><script type=\"text/javascript\" src=\"http://platform.twitter.com/widgets.js\"></script></p>','Amsterdam, 16 maart 2011\r\n&nbsp;\r\nWaarschuw vanaf nu anoniem je bedpartners via SoaAlarm.nl\r\nRondlopen met een vervelende SOA, maar je doodschamen om je bedpartners in te lichten - voor bijna een miljoen Nederlanders&sup1; is dit een pijnlijk herkenbare situatie. Schaamte, reputatie en religie zijn bekende argumenten van mensen die verzuimen hun intieme contacten te alarmeren bij het gevaar van een geslachtziekte. Maar niet zonder gevolgen: SOA die te laat ontdekt worden, kunnen een lelijk staartje krijgen!\r\n\r\nOp de website SoaAlarm.nl kun je vanaf vandaag gratis en anoniem je bedpartners waarschuwen voor de geslachtsziekte die ze mogelijk hebben opgelopen. Ontvang je een discrete e-mail van SOA Alarm? Dan krijg je direct belangrijke informatie over de geslachtsziekte, kun je zelf mensen inlichten en word je bovenal direct geadviseerd naar GGD of huisarts te gaan voor onderzoek en eventuele behandeling.\r\n\r\nIn Nederland lopen jaarlijks zo&rsquo;n honderdduizend mensen een SOA op. Onderzoek&sup2; wijst uit dat 51% van de jongens zijn bedpartners niet over hun SOA vertelt. Vooral jongeren en studenten lopen een groot risico op een SOA omdat ze veel kortdurende relaties hebben en lang niet altijd een condoom gebruiken. Verder worden mannen die seks hebben met mannen en 50-plussers oververtegenwoordigd in de statistieken. Chlamydia, gonorroe en herpes komen bij deze gevarengroepen het meeste voor.\r\n\r\nHet onafhankelijke SOA Alarm verwacht dit jaar minimaal 10.000 meldingen te versturen. SOA Alarm hoopt met dit initiatief de verspreiding van SOA te remmen en partnerwaarschuwing een boost te geven. Want dat is hard nodig.\r\nDownload het logo\r\n\r\n\r\nTweet'),
	(62,54,'<h3>Een e-mailadres blokkeren</h3>\r\n<p>Wilt u geen meldingen meer ontvangen van SOA&nbsp;alarm?&nbsp;Vul dan hieronder uw e-mailadres in, dan wordt deze geblokkeerd van onze dienst.</p>','Een e-mailadres blokkeren\r\nWilt u geen meldingen meer ontvangen van SOA&nbsp;alarm?&nbsp;Vul dan hieronder uw e-mailadres in, dan wordt deze geblokkeerd van onze dienst.'),
	(58,51,'<h3>Je bericht is verzonden.</h3>\r\n<p>We zullen je bericht zo snel mogelijk in behandeling nemen, en nemen zo nodig contact met je op.</p>\r\n<p><a href=\"http://www.soaalarm.nl\">Keer terug naar de startpagina.</a></p>\r\n<p>&nbsp;</p>','Je bericht is verzonden.\r\nWe zullen je bericht zo snel mogelijk in behandeling nemen, en nemen zo nodig contact met je op.\r\nKeer terug naar de startpagina.\r\n&nbsp;'),
