	(46,43,'	<link type=\"text/css\" rel=\"stylesheet\" href=\"http://www.soaalarm.nl/templates/assets/css/screen.css\" media=\"screen\" />\r\n\r\n<h3>De Algemene Voorwaarden van SOA ALARM</h3>\r\n<p><strong>De initiatiefnemers en organisatie van SOA&nbsp;Alarm en alle aan SOA Alarm  gelieerde domeinnamen en vertalingen zijn niet aansprakelijk voor enige  directe of indirecte schade die ontstaat of zou kunnen ontstaan door het  gebruik van deze website. Iedereen die een SOA&nbsp;Alarm stuurt en iedereen  die een SOA&nbsp;Alarm ontvangt wordt doorverwezen naar een GGD of huisarts.  Aan de inhoud van deze website kunnen op geen enkele wijze rechten  worden ontleend of aanspraken worden gemaakt.</strong><br />\r\n<strong><br />\r\nArtikel 1 Definities</strong><br />\r\n1.1 De volgende tussen aanhalingstekens geplaatste begrippen hebben de daarachter vermelde betekenis:<br />\r\n<br />\r\n&ldquo;Algemene Voorwaarden&rdquo;<br />\r\nDe onderhavige algemene voorwaarden.<br />\r\n<br />\r\n&ldquo;Content&rdquo;<br />\r\nTekst, beeld- en/of geluidsmateriaal, waaronder begrepen maar niet beperkt tot foto&rsquo;s en video&rsquo;s met of zonder geluid aslmede muziekwerken, en andere informatie.<br />\r\n<br />\r\n&ldquo;Gebruiker&rdquo;<br />\r\nIedere natuurlijke persoon of entiteit die via de Website Content ter beschikking stelt. <br />\r\n<br />\r\n&ldquo;Website&rdquo;<br />\r\nDe website www.SOAalarm.nl en alle aan SOA Alarm gelieerde domeinnamen en vertalingen.<br />\r\n<br />\r\n1.2 Onder de termen en uitdrukkingen in enkelvoud dient mede het meervoud daarvan begrepen te worden, alsmede vice versa. <br />\r\n<br />\r\n1.3 Verwijzingen naar Nederlandse rechtsbegrippen zullen, ten aanzien van andere jurisdicties dan de Nederlandse, worden geacht die rechtsbegrippen te omvatten die in de respectieve jurisdicties het dichtst de Nederlandse rechtsbegrippen naderen.<br />\r\n<br />\r\n1.4 De woorden &ldquo;waaronder begrepen&rdquo; en woorden met daaraan gelijke strekking, worden gebruikt om aan te duiden dat het genoemde illustratief is en zulks geen limitatieve opsomming betreft.<br />\r\n<br />\r\n1.5 De opschriften van de artikelen van de Algemene Voorwaarden zijn niet van invloed op de uitleg die aan de bepalingen van de Algemene Voorwaarden gegeven dient te worden.<br />\r\n<br />\r\n<strong>Artikel 2 Toepasselijkheid</strong><br />\r\n2.1 Deze Algemene Voorwaarden zijn van toepassing op ieder gebruik door een Gebruiker van de Website.<br />\r\n<br />\r\n2.2 Tenzij uitdrukkelijk en schriftelijk anders overeengekomen, is de toepasselijkheid van andere Algemene Voorwaarden uitgesloten.<br />\r\n<br />\r\n2.3 SOA Alarm heeft het recht om de Algemene Voorwaarden op ieder gewenst moment en zonder voorafgaande aankondiging aan te passen, aan te vullen of onderdelen daaruit te verwijderen. SOA Alarm adviseert iedere Gebruiker regelmatig de meest actuele Algemene Voorwaarden op de Website te raadplegen. <br />\r\n<br />\r\n<strong>Artikel 3 Privacy</strong><br />\r\n3.1 SOA Alarm zal de persoonlijke gegevens van de Gebruiker niet aan derden verstrekken zonder diens toestemming, tenzij een derde in verband met beweerdelijk inbreukmakend handelen van de Gebruiker om openbaarmaking van deze gegevens verzoekt dan wel een wettelijke verplichting haar daartoe verplicht.<br />\r\n<br />\r\n3.2 De Gebruiker is ervan op de hoogte en aanvaardt dat SOA Alarm diens persoonlijke gegevens verwerkt (i) om inzicht te verkrijgen in de manier waarop Gebruikers de Website gebruiken en (ii) om misbruik van de Website en andere illegale activiteiten te voorkomen.<br />\r\n&nbsp;<br />\r\n<strong>Artikel 4 Gedragsregels</strong><br />\r\n4.1 Het is een Gebruiker niet toegestaan de Website te gebruiken of doen gebruiken voor onrechtmatige handelingen, het plegen van strafbare feiten, of andere handelingen die in strijd zijn met enige wet of algemeen geldende normen en waarden. <br />\r\n<br />\r\n4.2 De Gebruiker is persoonlijk verantwoordelijk voor alles wat hij via de Website openbaar maakt. De Gebruiker garandeert dat een ieder die te zien is in de Content toestemming heeft verleend voor de openbaarmaking daarvan via de Website. <br />\r\n<br />\r\n4.3 Het is een Gebruiker niet toegestaan de Website te gebruiken voor commerci&euml;le doeleinden. <br />\r\n<br />\r\n<strong>Artikel 5 Intellectuele eigendomsrechten</strong><br />\r\n5.1 Iedere Gebruiker is ervan op de hoogte dat de Website bestanden bevat die eigendom zijn van SOA Alarm en/of andere Gebruikers, en die beschermd worden door intellectuele eigendomsrechten, waaronder auteursrechten, naburige rechten en merkrechten.<br />\r\n<br />\r\n5.2 Het is een Gebruiker niet toegestaan zonder uitdrukkelijke voorafgaande toestemming de werken die eigendom zijn van SOA Alarm en/of andere Gebruikers te kopi&euml;ren, verveelvoudigen, distribueren, bewerken of op enige andere wijze openbaar te maken en/of te verveelvoudigen. <br />\r\n<br />\r\n<strong>Artikel 6 Licentie SOA Alarm</strong><br />\r\n6.1 Indien naar het oordeel van SOA Alarm is komen vast te staan dat door de Gebruiker op de Website ter beschikking gestelde Content inbreuk maakt op enig recht van een derde, in strijd is met de Algemene Voorwaarden, of anderszins onrechtmatig is, is SOA Alarm gerechtigd om de betreffende Content van de Website te verwijderen. In dat geval is SOA Alarm eveneens gerechtigd om de persoonlijke gegevens van de Gebruiker aan derden, waaronder politie, justitie of rechthebbenden te verstrekken. SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade van de Gebruiker of derden ten gevolge van deze verwijdering of openbaarmaking van persoonlijke gegegevens.<br />\r\n<br />\r\n<strong>Artikel 7 Vrijwaringen </strong><br />\r\n7.1 De Gebruiker vrijwaart SOA Alarm en alle aan haar gelieerde personen voor eventuele aanspraken van derden met betrekking tot enig handelen van de Gebruiker in strijd met deze Algemene Voorwaarden. De Gebruiker is volledig aansprakelijk voor de door SOA Alarm gemaakte kosten en geleden schade verband houdend met deze aanspraken. <br />\r\n<br />\r\n7.2 De Gebruiker vrijwaart SOA Alarm voor eventuele aanspraken van derden, met betrekking tot de openbaarmaking, verveelvoudiging en/of vastlegging van de ter beschikking gestelde Content.<br />\r\n<br />\r\n<strong>Artikel 8 Aansprakelijkheid</strong><br />\r\n8.1 SOA Alarm is nimmer aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, van de Gebruiker of derden, verband houdend met of voortvloeiend uit onrechtmatig gebruik van de Website door de Gebruiker of door derden.<br />\r\n<br />\r\n8.2 SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, voortvloeiend uit aanspraken van derden jegens de Gebruiker, alsmede vice versa. <br />\r\n<br />\r\n8.3 SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, ten gevolge van het uitvallen of onbereikbaar zijn van het internet, elektronische storingen, en het kraken van de beveiliging van de Website door derden. <br />\r\n<br />\r\n8.4 SOA Alarm aanvaardt geen aansprakelijkheid voor de openbaarmaking en verspreiding van met virus besmette Content of andere informatie door de Gebruiker of door derden.<br />\r\n<br />\r\n<strong>Artikel 9 Overmacht</strong><br />\r\n9.1 SOA Alarm aanvaardt geen aansprakelijkheid voor tekortkomingen die het gevolg zijn van omstandigheden die niet aan SOA Alarm te wijten zijn, waaronder storingen in de elektriciteitsvoorziening, internet- en/of telefoonverbinding, overbezetting van internet-, telefoon- en/of andere verbindingen, tekortkomingen van derden en overheidsmaatregelen.<br />\r\n<br />\r\n<strong>Artikel 10 Slotbepalingen</strong><br />\r\n10.1 Indien &eacute;&eacute;n of meer bepalingen van deze Algemene Voorwaarden nietig zijn of vernietigd worden, blijven de overige bepalingen onverkort van kracht. SOA Alarm zal in dat geval de nietige of vernietigde bepaling(en) vervangen door (een) rechtsgeldige bepaling(en), waarbij zoveel mogelijk aansluiting wordt gezocht bij de oorspronkelijke bedoeling van de betreffende bepaling(en).<br />\r\n<br />\r\n10.2 Op de betrekking tussen SOA Alarm en de Gebruiker is Nederlands recht van toepassing.<br />\r\n<br />\r\n10.3 Alle geschillen welke voortvloeien uit of verband met deze Algemene Voorwaarden zullen worden voorgelegd aan de bevoegde rechter te Utrecht.</p>','	\r\n\r\nDe Algemene Voorwaarden van SOA ALARM\r\nDe initiatiefnemers en organisatie van SOA&nbsp;Alarm en alle aan SOA Alarm  gelieerde domeinnamen en vertalingen zijn niet aansprakelijk voor enige  directe of indirecte schade die ontstaat of zou kunnen ontstaan door het  gebruik van deze website. Iedereen die een SOA&nbsp;Alarm stuurt en iedereen  die een SOA&nbsp;Alarm ontvangt wordt doorverwezen naar een GGD of huisarts.  Aan de inhoud van deze website kunnen op geen enkele wijze rechten  worden ontleend of aanspraken worden gemaakt.\r\n\r\nArtikel 1 Definities\r\n1.1 De volgende tussen aanhalingstekens geplaatste begrippen hebben de daarachter vermelde betekenis:\r\n\r\n&ldquo;Algemene Voorwaarden&rdquo;\r\nDe onderhavige algemene voorwaarden.\r\n\r\n&ldquo;Content&rdquo;\r\nTekst, beeld- en/of geluidsmateriaal, waaronder begrepen maar niet beperkt tot foto&rsquo;s en video&rsquo;s met of zonder geluid aslmede muziekwerken, en andere informatie.\r\n\r\n&ldquo;Gebruiker&rdquo;\r\nIedere natuurlijke persoon of entiteit die via de Website Content ter beschikking stelt. \r\n\r\n&ldquo;Website&rdquo;\r\nDe website www.SOAalarm.nl en alle aan SOA Alarm gelieerde domeinnamen en vertalingen.\r\n\r\n1.2 Onder de termen en uitdrukkingen in enkelvoud dient mede het meervoud daarvan begrepen te worden, alsmede vice versa. \r\n\r\n1.3 Verwijzingen naar Nederlandse rechtsbegrippen zullen, ten aanzien van andere jurisdicties dan de Nederlandse, worden geacht die rechtsbegrippen te omvatten die in de respectieve jurisdicties het dichtst de Nederlandse rechtsbegrippen naderen.\r\n\r\n1.4 De woorden &ldquo;waaronder begrepen&rdquo; en woorden met daaraan gelijke strekking, worden gebruikt om aan te duiden dat het genoemde illustratief is en zulks geen limitatieve opsomming betreft.\r\n\r\n1.5 De opschriften van de artikelen van de Algemene Voorwaarden zijn niet van invloed op de uitleg die aan de bepalingen van de Algemene Voorwaarden gegeven dient te worden.\r\n\r\nArtikel 2 Toepasselijkheid\r\n2.1 Deze Algemene Voorwaarden zijn van toepassing op ieder gebruik door een Gebruiker van de Website.\r\n\r\n2.2 Tenzij uitdrukkelijk en schriftelijk anders overeengekomen, is de toepasselijkheid van andere Algemene Voorwaarden uitgesloten.\r\n\r\n2.3 SOA Alarm heeft het recht om de Algemene Voorwaarden op ieder gewenst moment en zonder voorafgaande aankondiging aan te passen, aan te vullen of onderdelen daaruit te verwijderen. SOA Alarm adviseert iedere Gebruiker regelmatig de meest actuele Algemene Voorwaarden op de Website te raadplegen. \r\n\r\nArtikel 3 Privacy\r\n3.1 SOA Alarm zal de persoonlijke gegevens van de Gebruiker niet aan derden verstrekken zonder diens toestemming, tenzij een derde in verband met beweerdelijk inbreukmakend handelen van de Gebruiker om openbaarmaking van deze gegevens verzoekt dan wel een wettelijke verplichting haar daartoe verplicht.\r\n\r\n3.2 De Gebruiker is ervan op de hoogte en aanvaardt dat SOA Alarm diens persoonlijke gegevens verwerkt (i) om inzicht te verkrijgen in de manier waarop Gebruikers de Website gebruiken en (ii) om misbruik van de Website en andere illegale activiteiten te voorkomen.\r\n&nbsp;\r\nArtikel 4 Gedragsregels\r\n4.1 Het is een Gebruiker niet toegestaan de Website te gebruiken of doen gebruiken voor onrechtmatige handelingen, het plegen van strafbare feiten, of andere handelingen die in strijd zijn met enige wet of algemeen geldende normen en waarden. \r\n\r\n4.2 De Gebruiker is persoonlijk verantwoordelijk voor alles wat hij via de Website openbaar maakt. De Gebruiker garandeert dat een ieder die te zien is in de Content toestemming heeft verleend voor de openbaarmaking daarvan via de Website. \r\n\r\n4.3 Het is een Gebruiker niet toegestaan de Website te gebruiken voor commerci&euml;le doeleinden. \r\n\r\nArtikel 5 Intellectuele eigendomsrechten\r\n5.1 Iedere Gebruiker is ervan op de hoogte dat de Website bestanden bevat die eigendom zijn van SOA Alarm en/of andere Gebruikers, en die beschermd worden door intellectuele eigendomsrechten, waaronder auteursrechten, naburige rechten en merkrechten.\r\n\r\n5.2 Het is een Gebruiker niet toegestaan zonder uitdrukkelijke voorafgaande toestemming de werken die eigendom zijn van SOA Alarm en/of andere Gebruikers te kopi&euml;ren, verveelvoudigen, distribueren, bewerken of op enige andere wijze openbaar te maken en/of te verveelvoudigen. \r\n\r\nArtikel 6 Licentie SOA Alarm\r\n6.1 Indien naar het oordeel van SOA Alarm is komen vast te staan dat door de Gebruiker op de Website ter beschikking gestelde Content inbreuk maakt op enig recht van een derde, in strijd is met de Algemene Voorwaarden, of anderszins onrechtmatig is, is SOA Alarm gerechtigd om de betreffende Content van de Website te verwijderen. In dat geval is SOA Alarm eveneens gerechtigd om de persoonlijke gegevens van de Gebruiker aan derden, waaronder politie, justitie of rechthebbenden te verstrekken. SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade van de Gebruiker of derden ten gevolge van deze verwijdering of openbaarmaking van persoonlijke gegegevens.\r\n\r\nArtikel 7 Vrijwaringen \r\n7.1 De Gebruiker vrijwaart SOA Alarm en alle aan haar gelieerde personen voor eventuele aanspraken van derden met betrekking tot enig handelen van de Gebruiker in strijd met deze Algemene Voorwaarden. De Gebruiker is volledig aansprakelijk voor de door SOA Alarm gemaakte kosten en geleden schade verband houdend met deze aanspraken. \r\n\r\n7.2 De Gebruiker vrijwaart SOA Alarm voor eventuele aanspraken van derden, met betrekking tot de openbaarmaking, verveelvoudiging en/of vastlegging van de ter beschikking gestelde Content.\r\n\r\nArtikel 8 Aansprakelijkheid\r\n8.1 SOA Alarm is nimmer aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, van de Gebruiker of derden, verband houdend met of voortvloeiend uit onrechtmatig gebruik van de Website door de Gebruiker of door derden.\r\n\r\n8.2 SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, voortvloeiend uit aanspraken van derden jegens de Gebruiker, alsmede vice versa. \r\n\r\n8.3 SOA Alarm is niet aansprakelijk voor enige directe of indirecte schade, waaronder mede begrepen gevolgschade, gederfde omzet en winst, verlies van gegevens en immateri&euml;le schade, ten gevolge van het uitvallen of onbereikbaar zijn van het internet, elektronische storingen, en het kraken van de beveiliging van de Website door derden. \r\n\r\n8.4 SOA Alarm aanvaardt geen aansprakelijkheid voor de openbaarmaking en verspreiding van met virus besmette Content of andere informatie door de Gebruiker of door derden.\r\n\r\nArtikel 9 Overmacht\r\n9.1 SOA Alarm aanvaardt geen aansprakelijkheid voor tekortkomingen die het gevolg zijn van omstandigheden die niet aan SOA Alarm te wijten zijn, waaronder storingen in de elektriciteitsvoorziening, internet- en/of telefoonverbinding, overbezetting van internet-, telefoon- en/of andere verbindingen, tekortkomingen van derden en overheidsmaatregelen.\r\n\r\nArtikel 10 Slotbepalingen\r\n10.1 Indien &eacute;&eacute;n