	(67,29,'<h4>Voorbeeld</h4>\r\n<p>Bekijk een <a href=\"/preview/\" id=\"preview\">voorbeeld</a> van de SOA Alarm e-mail die jouw bedpartners ontvangen.</p>\r\n<script>\r\n	$(document).ready(function(){\r\n		$(\"#preview\").fancybox({\r\n			\'width\'				: 800,\r\n			\'height\'			: \'90%\',\r\n	        \'autoScale\'     	: false,\r\n	        \'transitionIn\'		: \'none\',\r\n			\'transitionOut\'		: \'none\',\r\n			\'type\'				: \'iframe\'\r\n		});\r\n	});\r\n</script>','Voorbeeld\r\nBekijk een voorbeeld van de SOA Alarm e-mail die jouw bedpartners ontvangen.\r\n\r\n	$(document).ready(function(){\r\n		$(\"#preview\").fancybox({\r\n			\'width\'				: 800,\r\n			\'height\'			: \'90%\',\r\n	        \'autoScale\'     	: false,\r\n	        \'transitionIn\'		: \'none\',\r\n			\'transitionOut\'		: \'none\',\r\n			\'type\'				: \'iframe\'\r\n		});\r\n	});\r\n'),
	(52,47,'<h3>Preventie</h3>\r\n<p>Neem je verantwoordelijkheid en stop de verspreiding van gevaarlijke SOA, nu! Gebruik voorbehoedsmiddelen, neem voorzorgsmaatregelen en gebruik je gezonde verstand. Let op: maar weinig voorbehoedsmiddelen beschermen ook daadwerkelijk tegen SOA. De meesten werken alleen de zwangerschap tegen. Het allerbelangrijkste voorbehoedsmiddel is daarom het condoom, alleen deze biedt beschermen tegen vervelende SOA. <br />\r\n&nbsp;</p>\r\n<h4>Voorbehoedsmiddelen</h4>\r\n<ul>\r\n    <li>Condoom: het welbekende rubbertje dat om de penis wordt getrokken, om direct lichamelijk contact te voorkomen.</li>\r\n    <li>Anticonceptiepil: een pil die conceptie bij de vrouw tegengaat.</li>\r\n    <li>Morning-afterpil: een noodpil die n&aacute; de daad nog als anticonceptiemiddel gebruikt kan worden.</li>\r\n    <li>Sterilisatie: het definitief uitschakelen van de voorplantingsorganen.</li>\r\n    <li>Spiraaltje: object dat in de baarmoeder wordt geplaatst.</li>\r\n    <li>Zaaddodende pasta: speciale smeergel die de zaadcellen in het sperma doodt.</li>\r\n</ul>\r\n<h4>Feiten &amp;&nbsp;Mythes</h4>\r\n<ul>\r\n    <li>Een condoom is minder prettig. Mythe!&nbsp;Tegenwoordig worden condooms gefabriceerd die bijna ongemerkt meegaan.</li>\r\n    <li>Een condoom is honderd procent veilig. Mythe!&nbsp;Condooms kunnen scheuren bij verkeerd of agressief gebruik.</li>\r\n</ul>\r\n<p>&nbsp;</p>','Preventie\r\nNeem je verantwoordelijkheid en stop de verspreiding van gevaarlijke SOA, nu! Gebruik voorbehoedsmiddelen, neem voorzorgsmaatregelen en gebruik je gezonde verstand. Let op: maar weinig voorbehoedsmiddelen beschermen ook daadwerkelijk tegen SOA. De meesten werken alleen de zwangerschap tegen. Het allerbelangrijkste voorbehoedsmiddel is daarom het condoom, alleen deze biedt beschermen tegen vervelende SOA. \r\n&nbsp;\r\nVoorbehoedsmiddelen\r\n\r\n    Condoom: het welbekende rubbertje dat om de penis wordt getrokken, om direct lichamelijk contact te voorkomen.\r\n    Anticonceptiepil: een pil die conceptie bij de vrouw tegengaat.\r\n    Morning-afterpil: een noodpil die n&aacute; de daad nog als anticonceptiemiddel gebruikt kan worden.\r\n    Sterilisatie: het definitief uitschakelen van de voorplantingsorganen.\r\n    Spiraaltje: object dat in de baarmoeder wordt geplaatst.\r\n    Zaaddodende pasta: speciale smeergel die de zaadcellen in het sperma doodt.\r\n\r\nFeiten &amp;&nbsp;Mythes\r\n\r\n    Een condoom is minder prettig. Mythe!&nbsp;Tegenwoordig worden condooms gefabriceerd die bijna ongemerkt meegaan.\r\n    Een condoom is honderd procent veilig. Mythe!&nbsp;Condooms kunnen scheuren bij verkeerd of agressief gebruik.\r\n\r\n&nbsp;'),
	(47,44,'<h3>Jouw SOA&nbsp;Alarm:</h3>\r\n<p>Iemand in jouw omgeving heeft een Seksueel Overdraagbare Aandoening opgelopen en wil jou hiervan anoniem op de hoogte brengen.</p>','Jouw SOA&nbsp;Alarm:\r\nIemand in jouw omgeving heeft een Seksueel Overdraagbare Aandoening opgelopen en wil jou hiervan anoniem op de hoogte brengen.'),
	(49,44,'<p>&nbsp;</p>\r\n<p>Neem de mogelijkheid dat ook jij besmet bent uiterst serieus!<br />\r\nZoek direct medische hulp bij je huisart of een GGD-SOA polikliniek. <br />\r\nBeperk de mogelijke verspreiding en stop direct met onveilige seks.</p>\r\n<p>Bij SOA&nbsp;Alarm blijft iedereen anoniem, inclusief jij als ontvanger. Respecteer dat de verzender van dit bericht jou anoniem op de hoogte stelt. Hij of zij probeert te voorkomen dat de SOA verder wordt verspreid of voor jou ernstige gevolgen krijgt.</p>\r\n<p>Sommige SOA&nbsp;kun je jaren geleden opgelopen hebben en al die tijd ongemerkt bij je gedragen hebben. Algemene klachten zijn afscheiding, een branderig gevoel, pijn bij het plassen, vermoeidheid,  zweertjes of  wratjes, jeuk en pijn. Soms doen zich helemaal geen klachten voor, terwijl je de SOA&nbsp;wel bij je  draagt. Kies daarom altijd het zekere voor het onzekere en laat je zorgvuldig testen.</p>\r\n<p>Een SOA kun je oplopen door onveilige sex. Gebruik   daarom altijd een  condoom, je kunt ze eenvoudig en anoniem op internet bestellen.</p>\r\n<p>Heb je een SOA&nbsp;opgelopen? Waarschuw dan zo snel mogelijk je bedpartners. Sluit niemand uit!&nbsp;<br />\r\nGeef  iedereen de kans om zich tijdig te laten checken bij de huisart of een GGD-SOA polikliniek.<br />\r\n&nbsp;</p>\r\n<p>Een SOA heb je nooit alleen!</p>','&nbsp;\r\nNeem de mogelijkheid dat ook jij besmet bent uiterst serieus!\r\nZoek direct medische hulp bij je huisart of een GGD-SOA polikliniek. \r\nBeperk de mogelijke verspreiding en stop direct met onveilige seks.\r\nBij SOA&nbsp;Alarm blijft iedereen anoniem, inclusief jij als ontvanger. Respecteer dat de verzender van dit bericht jou anoniem op de hoogte stelt. Hij of zij probeert te voorkomen dat de SOA verder wordt verspreid of voor jou ernstige gevolgen krijgt.\r\nSommige SOA&nbsp;kun je jaren geleden opgelopen hebben en al die tijd ongemerkt bij je gedragen hebben. Algemene klachten zijn afscheiding, een branderig gevoel, pijn bij het plassen, vermoeidheid,  zweertjes of  wratjes, jeuk en pijn. Soms doen zich helemaal geen klachten voor, terwijl je de SOA&nbsp;wel bij je  draagt. Kies daarom altijd het zekere voor het onzekere en laat je zorgvuldig testen.\r\nEen SOA kun je oplopen door onveilige sex. Gebruik   daarom altijd een  condoom, je kunt ze eenvoudig en anoniem op internet bestellen.\r\nHeb je een SOA&nbsp;opgelopen? Waarschuw dan zo snel mogelijk je bedpartners. Sluit niemand uit!&nbsp;\r\nGeef  iedereen de kans om zich tijdig te laten checken bij de huisart of een GGD-SOA polikliniek.\r\n&nbsp;\r\nEen SOA heb je nooit alleen!');
