INSERT INTO `soaCMS_search` (`search_id`, `name`, `value`, `extra`)
VALUES
	(1,'header','<h1>[TEXT_SEARCH]</h1>\r\n\r\n<form name=\"searchpage\" action=\"[WB_URL]/search/index.php\" method=\"get\">\r\n<table cellpadding=\"3\" cellspacing=\"0\" border=\"0\" width=\"500\">\r\n<tr>\r\n<td>\r\n<input type=\"hidden\" name=\"search_path\" value=\"[SEARCH_PATH]\" />\r\n<input type=\"text\" name=\"string\" value=\"[SEARCH_STRING]\" style=\"width: 100%;\" />\r\n</td>\r\n<td width=\"150\">\r\n<input type=\"submit\" value=\"[TEXT_SEARCH]\" style=\"width: 100%;\" />\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">\r\n<input type=\"radio\" name=\"match\" id=\"match_all\" value=\"all\"[ALL_CHECKED] />\r\n<label for=\"match_all\">[TEXT_ALL_WORDS]</label>\r\n<input type=\"radio\" name=\"match\" id=\"match_any\" value=\"any\"[ANY_CHECKED] />\r\n<label for=\"match_any\">[TEXT_ANY_WORDS]</label>\r\n<input type=\"radio\" name=\"match\" id=\"match_exact\" value=\"exact\"[EXACT_CHECKED] />\r\n<label for=\"match_exact\">[TEXT_EXACT_MATCH]</label>\r\n</td>\r\n</tr>\r\n</table>\r\n\r\n</form>\r\n\r\n<hr />\r\n	',''),
	(2,'footer','',''),
	(3,'results_header','[TEXT_RESULTS_FOR] \'<b>[SEARCH_STRING]</b>\':\r\n<table cellpadding=\"2\" cellspacing=\"0\" border=\"0\" width=\"100%\" style=\"padding-top: 10px;\">',''),
	(4,'results_loop','<tr style=\"background-color: #F0F0F0;\">\r\n<td><a href=\"[LINK]\">[TITLE]</a></td>\r\n<td align=\"right\">[TEXT_LAST_UPDATED_BY] [DISPLAY_NAME] ([USERNAME]) [TEXT_ON] [DATE]</td>\r\n</tr>\r\n<tr><td colspan=\"2\" style=\"text-align: justify; padding-bottom: 5px;\">[DESCRIPTION]</td></tr>\r\n<tr><td colspan=\"2\" style=\"text-align: justify; padding-bottom: 10px;\">[EXCERPT]</td></tr>',''),
	(5,'results_footer','</table>',''),
	(6,'no_results','<tr><td><p>[TEXT_NO_RESULTS]</p></td></tr>',''),
	(7,'module_order','faqbaker,manual,wysiwyg',''),
	(8,'max_excerpt','15',''),
	(9,'time_limit','0',''),
	(10,'cfg_enable_old_search','true',''),
	(11,'cfg_search_keywords','true',''),
	(12,'cfg_search_description','true',''),
	(13,'cfg_show_description','true',''),
	(14,'cfg_enable_flush','false',''),
	(15,'template','',''),
	(16,'module','code','a:6:{s:7:\"page_id\";s:7:\"page_id\";s:5:\"title\";s:10:\"page_title\";s:4:\"link\";s:4:\"link\";s:11:\"description\";s:11:\"description\";s:13:\"modified_when\";s:13:\"modified_when\";s:11:\"modified_by\";s:11:\"modified_by\";}'),
	(17,'query_start','SELECT [TP]pages.page_id, [TP]pages.page_title,	[TP]pages.link, [TP]pages.description, [TP]pages.modified_when, [TP]pages.modified_by	FROM [TP]mod_code, [TP]pages WHERE ','code'),
	(18,'query_body',' [TP]pages.page_id = [TP]mod_code.page_id AND [TP]mod_code.content [O] \'[W][STRING][W]\' AND [TP]pages.searching = \'1\'','code'),
	(19,'query_end','','code'),
	(20,'module','form','a:6:{s:7:\"page_id\";s:7:\"page_id\";s:5:\"title\";s:10:\"page_title\";s:4:\"link\";s:4:\"link\";s:11:\"description\";s:11:\"description\";s:13:\"modified_when\";s:13:\"modified_when\";s:11:\"modified_by\";s:11:\"modified_by\";}'),
	(21,'query_start','SELECT [TP]pages.page_id, [TP]pages.page_title,	[TP]pages.link, [TP]pages.description, [TP]pages.modified_when, [TP]pages.modified_by	FROM [TP]mod_form_fields, [TP]mod_form_settings, [TP]pages WHERE ','form'),
	(22,'query_body',' [TP]pages.page_id = [TP]mod_form_settings.page_id AND [TP]mod_form_settings.header LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_form_settings.page_id AND [TP]mod_form_settings.footer LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_form_fields.page_id AND [TP]mod_form_fields.title LIKE \'%[STRING]%\' ','form'),
	(23,'query_end','','form'),
	(24,'module','news','a:6:{s:7:\"page_id\";s:7:\"page_id\";s:5:\"title\";s:10:\"page_title\";s:4:\"link\";s:4:\"link\";s:11:\"description\";s:11:\"description\";s:13:\"modified_when\";s:13:\"modified_when\";s:11:\"modified_by\";s:11:\"modified_by\";}'),
	(25,'query_start','SELECT [TP]pages.page_id, [TP]pages.page_title,	[TP]pages.link, [TP]pages.description, [TP]pages.modified_when, [TP]pages.modified_by	FROM [TP]mod_news_posts, [TP]mod_news_groups, [TP]mod_news_comments, [TP]mod_news_settings, [TP]pages WHERE ','news'),
	(26,'query_body','\r\n    	[TP]pages.page_id = [TP]mod_news_posts.page_id AND [TP]mod_news_posts.title LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_posts.page_id AND [TP]mod_news_posts.content_short LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_posts.page_id AND [TP]mod_news_posts.content_long LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_comments.page_id AND [TP]mod_news_comments.title LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_comments.page_id AND [TP]mod_news_comments.comment LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.header LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.footer LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.post_header LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.post_footer LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.comments_header LIKE \'%[STRING]%\'\r\n    	OR [TP]pages.page_id = [TP]mod_news_settings.page_id AND [TP]mod_news_settings.comments_footer LIKE \'%[STRING]%\'','news'),
	(27,'query_end','','news'),
	(28,'module','wysiwyg','a:6:{s:7:\"page_id\";s:7:\"page_id\";s:5:\"title\";s:10:\"page_title\";s:4:\"link\";s:4:\"link\";s:11:\"description\";s:11:\"description\";s:13:\"modified_when\";s:13:\"modified_when\";s:11:\"modified_by\";s:11:\"modified_by\";}'),
	(29,'query_start','SELECT [TP]pages.page_id, [TP]pages.page_title,	[TP]pages.link, [TP]pages.description, [TP]pages.modified_when, [TP]pages.modified_by	FROM [TP]mod_wysiwyg, [TP]pages WHERE ','wysiwyg'),
	(30,'query_body',' [TP]pages.page_id = [TP]mod_wysiwyg.page_id AND [TP]mod_wysiwyg.text [O] \'[W][STRING][W]\' AND [TP]pages.searching = \'1\'','wysiwyg'),
	(31,'query_end','','wysiwyg'),
	(32,'module','formlist','a:6:{s:7:\"page_id\";s:7:\"page_id\";s:5:\"title\";s:10:\"page_title\";s:4:\"link\";s:4:\"link\";s:11:\"description\";s:11:\"description\";s:13:\"modified_when\";s:13:\"modified_when\";s:11:\"modified_by\";s:11:\"modified_by\";}'),
	(33,'query_start','SELECT [TP]pages.page_id, [TP]pages.page_title,  [TP]pages.link, [TP]pages.description, [TP]pages.modified_when, [TP]pages.modified_by  FROM [TP]mod_formlist_fields, [TP]mod_formlist_settings, [TP]pages WHERE ','formlist'),
	(34,'query_body',' [TP]pages.page_id = [TP]mod_formlist_settings.page_id AND [TP]mod_formlist_settings.header LIKE \'%[STRING]%\'\n  OR [TP]pages.page_id = [TP]mod_formlist_settings.page_id AND [TP]mod_formlist_settings.footer LIKE \'%[STRING]%\'\n  OR [TP]pages.page_id = [TP]mod_formlist_fields.page_id AND [TP]mod_formlist_fields.title LIKE \'%[STRING]%\' ','formlist'),
	(35,'query_end','','formlist');
